    return(
        <>
        <div className="header">
        <img id="cabecalho "src={azul}  width="1352" height="442"/>
        <img src={logo} width="50%"/>
               <ul>   
    <li><a href="/">Informações</a></li>
    <li><a href="/cards">cartões </a></li>
    <li><a href="/new">novo    </a></li>   
    <li><a href="/singlecard/:id">ver seu card</a></li>
    </ul>
      
        </div>

        </>
    )
}
export default Header;
